import React from 'react';
import bg6 from '../img/bg6.jpg'
import '../styles/engajar.css';
import img0 from "../img/img0.jpg";
import img4 from "../img/img4.png";
import logo from "../img/logo.png";
import 'antd/dist/antd.css';import 'antd/dist/antd.css';
import { Card, Avatar } from 'antd';
import { InstagramOutlined, TwitterOutlined, WhatsAppOutlined } from '@ant-design/icons';


const { Meta } = Card;




export default function Engajar() {
 return (
   <div className="fullpage3" style={{ backgroundImage: `url(${bg6})` }}>
     <h1>Faça uma doação e torne-se um padrinho,um pequeno gesto pode mudar uma realidade inteira.</h1>
     <div className='fp20'>
       <div className="heart"><img src={require('../img/img4.png')} /></div>
       <div className="doe">
       <Card
    style={{ width: 300 }}
    cover={
      <img
        alt="example"
        src="https://gw.alipayobjects.com/zos/rmsportal/JiqGstEfoWAOHiTxclqi.png"
      />
    }
    actions={[
      <WhatsAppOutlined key="whatsapp" />,
      <InstagramOutlined key="insta" />,
      <TwitterOutlined key="tt" />,
    ]}
  >
    <Meta
      avatar={<Avatar src={require('../img/logo.png')} />}
      title="Contamos com você!!"
      description="Pequenos gestos tornam-se grandes quando feitos com amor."
    />
  </Card>         
       </div>



     </div>

   </div>   
 );
}
